import Image from '../AllProuducts/5.png';

class AllProducts extends Component {
    render() { 
        return ( 
            <div className="AllProducts1">
            <NavBar />
            <div className="AllProducts  col-lg-3 col-md-6 col-xs-12">
          <div className="item"></div>
          <div className="item"></div>
            </div>  
            <Footer />
            </div>
         );
    }
}

export default AllProducts;
